-- Legacy asset notes import (generated from it_equipment (1).sql)
-- Updates current assets.notes by matching asset_tag

BEGIN;

CREATE TEMP TABLE legacy_asset_notes (
  asset_tag TEXT PRIMARY KEY,
  legacy_notes TEXT
);


-- Preview: notes candidates to be imported
SELECT l.asset_tag, left(l.legacy_notes, 120) AS preview, length(l.legacy_notes) AS note_length
FROM legacy_asset_notes l
ORDER BY l.asset_tag;

UPDATE assets a
SET notes = l.legacy_notes,
    updated_at = NOW()
FROM legacy_asset_notes l
WHERE upper(btrim(a.asset_tag)) = upper(btrim(l.asset_tag));

SELECT COUNT(*) AS assets_with_notes
FROM assets
WHERE btrim(coalesce(notes, '')) <> '';

COMMIT;
